import { BrowserRouter, Switch, Route } from 'react-router-dom'
import './App.css';

class App extends Component {
  render() {
    return [
      <BrowserRouter>
        <Switch>
          <Route exact path='/' component={signInPage} />
        </Switch>
      </BrowserRouter>
    ]
  }
}

export default App;
